import { useState } from "react";
import "./Grid.css";
import { myGrid } from "./calc.js";
import Box from "./Box";
import BoxClass from "./calc";

function Grid(props) {
  const [grid, setGrid] = useState([]);

  for (let i = 0; i < 8; i++) {
    grid[i] = [];
    for (let j = 0; j < 8; j++) {
      grid[i][j] = new BoxClass(i, j);
    }
  }

  return (
    <div className="myGrid">
      {props.boxes.map((items) => {
        return (
          <div className="gridLine" key={items.id}>
            {items.map((subItem) => {
              return <Box key={subItem.id} index={subItem.i} />;
            })}
          </div>
        );
      })}
    </div>
  );
}

export default Grid;
